import Navbar from '../components/Navbar'
import './SignUp.css';
import SignImg from '../images/SignupImg.svg'

function SignUp() {
  return (
    <div className="signup-container">
      <Navbar />
      <div className="inputs-container">
          <form className="inputs">
            <h1 id="signup-title">Sign Up</h1>
            <input placeholder="Username" type="text" name="username" className="inputs-sign-up"/>
            <input placeholder="Email" type="email"  name="email" className="inputs-sign-up"/>
            <input placeholder='Password' type="password"  name="password" className="inputs-sign-up"/>
            <button>Sign Up</button>
          </form>
      </div>
        <img src={SignImg} className="singup-img"/>
    </div>

  );
}

export default SignUp;
